import React from "react";

export function Form({ userInput, handleFormChange, handleFormSubmit }) {
    const handleChange = (e) => {
        handleFormChange(e.target.value);
    }

    const handleSubmit = (e) => {
        e.preventDefault();
    }

    return (
        <>
            <form onSubmit={handleSubmit}>
                <input type="text" required placeholder="Search" value={userInput} onChange={handleChange}  />
                <input type="submit" value="Search" />
            </form>

        </>
    )
}
